V8:
Mənzil Tam Təmirlidir. 
Mənzildən dənizə panorama açılır. 
Yaxınlığında məktəb, bagca, aptek, market və digər iaşə obyektləri mövcuddur. 35-ci polis bolməsinin yaninda yerləşir.

Mənzilin ümumi sahəsi:
- 86 (kvadratmetrə);
- Cıxarış var.

Mənzildə:
- Qaz;
- İşıq;
- Su;
- Kombi Sistemi;
- Isti döşəmə;
- KATV çəkilib.

Xatai prospektinde, Tələt Şıxəliyev və Qarabağ küçələrinin kəsişməsində, Təhsil nazirliyinin və H.Əliyev mərkəzinin, Şuşa və Çanaqqala restoranların, Şərq bazarının yanında yerləşən mənzil satılır. Bina çox əlverişli yerdə yerləşir:
• Nərimanov;
• 28 may;
• Gənclik metrostansiyalarından 5 dəqiqəlik məsafədədir.
Müasir mənzil elit evin bütün üstünlüklərinə malikdir:
• 24 saat mühafizə;
• video nəzarət; 
• geniş yaşıl həyət;
• müasir uşaq meydançası;
• fitness;
• yüksəksürətli liftlər; 
• yerüstü və yeraltı parking;
Mənzil mərkəzi istiliklə qızdırılır: qaz,su, işıq daimidir.
Binayla üzbəüz  №177 orta məktəb yerləşir. Baxça, park, ticarət mərkəzləri, bir sözlə bütün infrastrukturlara yaxındır. 
Mənzilin ümumi sahəsi 50,2 kv.m.
Qiymət: 93 000 azn.
